let initialState ={
    Express_main: [
        {id: '/calculate',title:'Калькулятор' , active: 'classes.active'},
        {id: '/users', title:'Мои отправления', active: 'classes.active'},
        {id: '/my_shipments', title:'Счета и оплата', active: 'classes.active'},
        {id: '/my_address', title:'Адреса и контакты', active: 'classes.active'},
    ],

    Сargo_main: [
        {id: '/calculate',title:'Найти машины' , active: 'classes.active'},
        {id: '/users', title:'Найти грузы', active: 'classes.active'},
        {id: '/my_shipments', title:'Счета и оплата', active: 'classes.active'},
        {id: '/my_address', title:'Адреса и контакты', active: 'classes.active'},
    ]
};
const SidebarReducer = (state = initialState, action)=>
{
    return state;
}

export default SidebarReducer;
